import Logo from '../Logo';
import NavBar from "../NavBar";
import IconesNavBar from "../IconesNavBar";



function Header() {
    <HeaderContainer>
        <Logo />
        <NavBar />
        <IconesNavBar />
    </HeaderContainer>
}


export default Header
